import React from "react";
import { Link, useParams, useRouteMatch } from "react-router-dom"

export default function Breadcrumb({ page = "", deck = {} }) {
    const url = useRouteMatch();
    const { deckId } = useParams();

    return (
        <nav aria-label="breadcrumb">
            <ol class="breadcrumb">
                <li class="breadcrumb-item" aria-current="page"><Link to="/">Home</Link></li>
                {(page) && <li class="breadcrumb-item active" aria-current="page">{page}</li>}
                {(deck.name) && <li class="breadcrumb-item active" aria-current="page">{deck.name}</li>}
                {(page === "study") && <li class="breadcrumb-item active" aria-current="page">Study</li>}
            </ol>
        </nav>
    )

}
